arrows.css:
.clean_arrows.sr7-arrows {
  width:##width##px;
  height:##height##px;
  background:##background##;
 }
 .clean_arrows.sr7-arrows:before {
 color: ##arrowcolor##;
 width:##width##px;
 height:##height##px;
 line-height:##height##px;
 font-size:##font-size##px;
 transition:all 0.3s;
-webkit-transition:all 0.3s;
 }

  .clean_arrows.sr7-arrows.sr7-touchhover:before {
    transform: scale(1.1);
  }

tabs.css:
.awesometabs {
 backdrop-filter: blur(20px); 
}

.awesometabs .sr7-tab { 
  opacity:1;      
  padding:0px;
  box-sizing:border-box;
  font-family: ##font##;
  border-bottom: 3px solid ##borderc##;
  background: transparent;
  transition: background-color 0.3s ease, border-color 0.3s ease;
}

.awesometabs .sr7-tab-img 
{ 
  width:70px;
  height:##size##px; 
    position: absolute;
    display: inline-block;
    margin: 0;
    right: 15px;
    left: auto;
    top: 10px;
	opacity: 0.5;
	border-radius: 4px 4px 0 0;
	transition: opacity 0.3s ease, right 0.3s ease;
}

.awesometabs .sr7-tab.selected .sr7-tab-img,
.awesometabs .sr7-tab.selected.sr7-touchhover .sr7-tab-img  {
	opacity: 1;
	right: 25px;
}

.awesometabs .sr7-tab.sr7-touchhover .sr7-tab-img  {
	opacity: 1;
	right: 15px;
}

.awesometabs .sr7-tab-content 
{
    position:relative;
    padding:10px 0;
    left:15px;
    overflow:hidden;
    box-sizing:border-box;
    color:##color##;
    display: inline-block;
    width:100%;
    height:100%;
 position:absolute; }

.awesometabs .sr7-tab-title
  {
  display:block;
  color: ##titlecolor##;
  font-weight:800;
  font-size:##titlesize##px;
  line-height:##titlesize##px !important;
  margin-bottom:0px;
  text-transform: uppercase;
    letter-spacing: 0px;
	transition: color 0.3s ease;
	margin-top: 8px;
  }

.awesometabs .sr7-tab-param 
{
    display:block;  
    text-align:left;
    color:##titlecolor##;
    font-size:##datesize##px;
	line-height:##datesize##px !important;
    font-weight:300;
    text-transform:none;
    line-height:20px;
	transition: color 0.3s ease;
	margin-top: 5px;
}

.awesometabs .sr7-tab.selected {
  background:##hbg##;
  border-bottom: 3px solid transparent !important;
  box-shadow: 5px 5px ##selected-border##;
  border-radius: 4px 4px 0 0;
}

.awesometabs .sr7-tab.selected.sr7-touchhover {
	 border-bottom: 3px solid transparent !important;
}

.awesometabs .sr7-tab.selected .sr7-tab-title, 
.awesometabs .sr7-tab.selected.sr7-touchhover .sr7-tab-title
  {
  color: ##hover-title##;
  }

.awesometabs .sr7-tab.selected .sr7-tab-param,
.awesometabs .sr7-tab.selected.sr7-touchhover .sr7-tab-param
{
    color: ##hover-title##;
}

.awesometabs .sr7-tab.sr7-touchhover .sr7-tab-title
  {
  color: ##hover-color##;
  }

.awesometabs .sr7-tab.sr7-touchhover .sr7-tab-param
{
    color: ##hover-color##;
}

.awesometabs .sr7-tab.sr7-touchhover
  {
  border-bottom: 3px solid ##hover-border##;
  }

